Here's a sample Spark job in Java that calculates the hit rate for the onsite attributed data based on the top frequent queries:

```java
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.JavaSparkContext;
import org.apache.spark.api.java.function.Function;
import scala.Tuple2;

import java.io.Serializable;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class HitRateCalculator {
    public static void main(String[] args) {
        // Create a JavaSparkContext
        JavaSparkContext sc = new JavaSparkContext("local", "HitRateCalculator");

        // Load the onsite attributed data and top frequent queries
        JavaRDD<String> onsiteData = sc.textFile("path/to/onsite_data.txt");
        JavaRDD<String> topQueries = sc.textFile("path/to/top_queries.txt");

        // Convert the top frequent queries to a list
        List<String> topQueriesList = topQueries.collect();

        // Create a broadcast variable for the top queries
        final List<String> topQueriesBroadcast = sc.broadcast(topQueriesList);

        // Create an accumulator for cache hits and cache misses
        final LongAccumulator cacheHits = sc.sc().longAccumulator("cacheHits");
        final LongAccumulator cacheMisses = sc.sc().longAccumulator("cacheMisses");

        // Create a map to store the cached queries and their expiration time
        final Map<String, Long> cache = new HashMap<>();

        // Process each record in the onsite attributed data
        JavaRDD<String> processedData = onsiteData.map(new Function<String, String>() {
            @Override
            public String call(String record) throws Exception {
                // Parse the record to extract the query and timestamp
                String[] fields = record.split(",");
                String query = fields[0];
                long timestamp = Long.parseLong(fields[1]);

                // Check if the query is in the top frequent queries
                if (topQueriesBroadcast.value().contains(query)) {
                    // Check if the query is already cached
                    if (cache.containsKey(query)) {
                        // Check if the cached query has expired
                        if (cache.get(query) > timestamp) {
                            // Cache hit
                            cacheHits.add(1);
                        } else {
                            // Cache miss, update the cache with new expiration time
                            cache.put(query, timestamp + 12 * 60 * 60 * 1000); // 12 hours in milliseconds
                            cacheMisses.add(1);
                        }
                    } else {
                        // Cache miss, add the query to the cache with expiration time
                        cache.put(query, timestamp + 12 * 60 * 60 * 1000); // 12 hours in milliseconds
                        cacheMisses.add(1);
                    }
                }

                return record;
            }
        });

        // Trigger the computation by performing an action (e.g., count)
        long count = processedData.count();

        // Calculate the hit rate
        long totalRequests = cacheHits.value() + cacheMisses.value();
        double hitRate = (double) cacheHits.value() / totalRequests;

        // Print the results
        System.out.println("Total requests: " + totalRequests);
        System.out.println("Cache hits: " + cacheHits.value());
        System.out.println("Cache misses: " + cacheMisses.value());
        System.out.println("Hit rate: " + hitRate);

        // Stop the Spark context
        sc.stop();
    }
}
```

