export default Tooltip;
```
In this component, we use the useTooltip hook to access the tooltipOpen state and the openTooltip and closeTooltip functions from the tooltip context.

We render the children of the Tooltip component inside a div with the className "tooltip-trigger" . We attach the openTooltip function to the onMouseEnter event and the closeTooltip function to the onMouseLeave event. This ensures that the tooltip opens when the user hovers over the trigger element and closes when the user moves the mouse away.

We also conditionally render the tooltip content based on the tooltipOpen state. If tooltipOpen is true, we render the content inside a div with the className "tooltip-content" .

## Usage

Now, we can use the Tooltip component anywhere in our application.
